"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[9115],{9115:e=>{e.exports=JSON.parse('{"lessonId":"B1_U60","title":"\u0423\u0440\u043e\u043a 60: Pret\xe9rito perfecto (1)","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0424\u043e\u0440\u043c\u044b Pret\xe9rito perfecto","content":[{"text":"<strong>He tenido, me he levantado, he dado</strong> \u0438 <strong>he hecho</strong> \u2014 \u044d\u0442\u043e \u0444\u043e\u0440\u043c\u044b \u0441\u043b\u043e\u0436\u043d\u043e\u0433\u043e \u043f\u0440\u043e\u0448\u0435\u0434\u0448\u0435\u0433\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438 (pret\xe9rito perfecto de indicativo)."},{"text":"<strong>`presente de indicativo de haber` + `participio` (\u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u0435)</strong>"},{"table":{"headers":[],"rows":[["(yo) he","(nosotros, -as) hemos"],["(t\xfa) has","trabajado","(vosotros, -as) hab\xe9is","vivido"],["(usted) ha","comido","(ustedes) han"],["(\xe9l, ella) ha","","(ellos, -as) han"]]}},{"text":"<strong>ATENCI\xd3N:</strong><br>\u0424\u043e\u0440\u043c\u0430 \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u044f \u043d\u0435 \u043c\u0435\u043d\u044f\u0435\u0442\u0441\u044f.<br><i>\u2013Hoy <strong>he comido</strong> paella.<br>\u2013Pues nosotras <strong>hemos comido</strong> pescado.</i><br><br>Haber \u0438 \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u0435 \u0432\u0441\u0435\u0433\u0434\u0430 \u0432\u043c\u0435\u0441\u0442\u0435.<br><i><strong>Me he levantado</strong> tarde.</i>"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 Pret\xe9rito perfecto","content":[{"text":"<strong>1. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u0440\u0430\u0437\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u0445 \u0438\u043b\u0438 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u044f\u0445, \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0435\u0434\u0448\u0438\u0445 \u0432 \u043f\u0435\u0440\u0438\u043e\u0434 \u0432\u0440\u0435\u043c\u0435\u043d\u0438, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u0435\u0442\u0441\u044f \u0434\u043e \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0433\u043e \u043c\u043e\u043c\u0435\u043d\u0442\u0430.</strong><br><i>`hoy`, `esta ma\xf1ana/tarde/semana`, `este mes/a\xf1o`, `\xfaltimamente...`<br>Hoy <strong>me he levantado</strong> tarde.<br>Lara <strong>ha salido</strong> todas las noches esta semana.<br>Este mes <strong>hemos ido</strong> al cine tres veces.<br>Este a\xf1o no <strong>ha hecho</strong> mucho fr\xedo.</i>"},{"text":"<strong>2. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u0440\u0430\u0437\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u043f\u0440\u043e\u0448\u043b\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u0445 \u0441 \u043d\u0435\u043f\u043e\u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0441\u0432\u044f\u0437\u044c\u044e \u0441 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0438\u043c: `hace poco`, `hace un momento`, `hace un rato`.</strong><br><i><strong>He estado</strong> con Carlos hace un momento.<br>Juego muy mal al golf. <strong>He aprendido</strong> hace poco.</i>"},{"text":"<strong>3. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f, \u0447\u0442\u043e\u0431\u044b \u0441\u043f\u0440\u043e\u0441\u0438\u0442\u044c \u0438\u043b\u0438 \u0441\u043e\u043e\u0431\u0449\u0438\u0442\u044c \u043e \u043d\u0435\u0434\u0430\u0432\u043d\u0438\u0445 \u043d\u043e\u0432\u043e\u0441\u0442\u044f\u0445.</strong><br><i>\u2013\xbfQu\xe9 <strong>ha pasado</strong>? \u2013Ha dimitido el presidente.</i>"},{"text":"<strong>4. \u0412\u043e \u043c\u043d\u043e\u0433\u0438\u0445 \u0447\u0430\u0441\u0442\u044f\u0445 \u041b\u0430\u0442\u0438\u043d\u0441\u043a\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0438 \u0438 \u0418\u0441\u043f\u0430\u043d\u0438\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `Pret\xe9rito indefinido` (Com\xed) \u0432\u043c\u0435\u0441\u0442\u043e `Pret\xe9rito perfecto` (He comido).</strong>"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 60.1","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 60.1 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043e, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u043e \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0430\u043d\u0430\u043b\u0438\u0437\u0435 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0439.</strong>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 60.2: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 Pret\xe9rito perfecto","tasks":[{"id":"u60_2_1","sentence":"1. Este verano (nosotros, estar) ___ en Per\xfa.","answer":"hemos estado"},{"id":"u60_2_2","sentence":"2. \u2013\xbf(t\xfa, ver) ___ a Cristina? \u2013S\xed, la (yo, ver) ___ hace un momento.","answer":"Has visto, he visto"},{"id":"u60_2_3","sentence":"3. Hoy (nosotros, trabajar) ___ cerca de diez horas.","answer":"hemos trabajado"},{"id":"u60_2_4","sentence":"4. Este a\xf1o (llover) ___ mucho.","answer":"ha llovido"},{"id":"u60_2_5","sentence":"5. \u2013\xbfSabes usar este programa? \u2013Regular. (yo, empezar) ___ a usarlo hace poco.","answer":"He empezado"},{"id":"u60_2_6","sentence":"6. Mis padres (estar) ___ en la costa este invierno.","answer":"han estado"},{"id":"u60_2_7","sentence":"7. \xbfQu\xe9 (t\xfa, leer) ___ este verano? ___ algo interesante \xfaltimamente?","answer":"has le\xeddo, Has le\xeddo"},{"id":"u60_2_8","sentence":"8. Hoy (nosotras, comer) ___ ceviche de marisco.","answer":"hemos comido"},{"id":"u60_2_9","sentence":"9. Hoy (nosotras, comer) ___ ceviche de marisco.","answer":"hemos comido"},{"id":"u60_2_10","sentence":"10. \u2013\xbfQu\xe9 (hacer) ___ Mart\xedn este verano? \u2013(Quedarse) ___ en Madrid. No ten\xeda dinero.","answer":"ha hecho, Se ha quedado"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 60.3: \u041d\u0430\u043f\u0438\u0448\u0438\u0442\u0435 \u043d\u043e\u0432\u043e\u0441\u0442\u043d\u044b\u0435 \u0437\u0430\u0433\u043e\u043b\u043e\u0432\u043a\u0438","tasks":[{"id":"u60_3_1","sentence":"1. Fuga de 50 presos. \u2192 Se ___ 50 presos.","answer":"han escapado"},{"id":"u60_3_2","sentence":"2. Fallece el Presidente. \u2192 ___ el Presidente.","answer":"Ha fallecido"},{"id":"u60_3_3","sentence":"3. Dimite la ministra de Hacienda. \u2192 ___ la ministra de Hacienda.","answer":"Ha dimitido"},{"id":"u60_3_4","sentence":"4. Fin de la huelga del transporte. \u2192 ___ la huelga del transporte.","answer":"Ha acabado"},{"id":"u60_3_5","sentence":"5. Choque de dos trenes. \u2192 ___ dos trenes.","answer":"Han chocado"},{"id":"u60_3_6","sentence":"6. Sube la gasolina. \u2192 ___ la gasolina.","answer":"Ha subido"},{"id":"u60_3_7","sentence":"7. Bajan los impuestos. \u2192 ___ los impuestos.","answer":"Han bajado"},{"id":"u60_3_8","sentence":"8. Colo-Colo, campe\xf3n de Liga. \u2192 Colo-Colo ___ la Liga.","answer":"ha ganado"}]}]}')}}]);